import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';

const HomePage = () => {
    const [user, setUser] = useState(null);
    const [movies, setMovies] = useState([]);
    const [search, setSearch] = useState('');

    useEffect(() => {
        const token = localStorage.getItem('token');
        if (token) {
            axios.get('http://localhost:3005/user-info', {
                headers: { Authorization: `Bearer ${token}` }
            }).then(response => {
                setUser(response.data);
            }).catch(() => {
                setUser(null);
            });
        }
    }, []);

    const handleLogout = () => {
        localStorage.removeItem('token');
        setUser(null);
    };

    const handleSearch = (event) => {
        event.preventDefault();
        axios.get(`http://localhost:3005/movies/search?query=${search}`)
            .then(response => setMovies(response.data))
            .catch(err => console.error('Error searching movies:', err));
    };

    return (
        <div>
            <nav className="navbar navbar-expand-lg bg-body-tertiary">
                <div className="container-fluid">
                    <a className="navbar-brand" href="#">Navbar</a>
                    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <div className="collapse navbar-collapse" id="navbarSupportedContent">
                        <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                            <li className="nav-item">
                                <a className="nav-link active" aria-current="page" href="#">Home</a>
                            </li>
                            <li className="nav-item">
                                {user ? (
                                    <>
                                        <span className="nav-link">{user.username}</span>
                                        <a className="nav-link" onClick={handleLogout}>Logout</a>
                                    </>
                                ) : (
                                    <>
                                        <Link to="/login" className="nav-link">Login</Link>
                                        <Link to="/register" className="nav-link">Register</Link>
                                    </>
                                )}
                            </li>
                        </ul>
                        <form className="d-flex" role="search" onSubmit={handleSearch}>
                            <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search" onChange={e => setSearch(e.target.value)} />
                            <button className="btn btn-outline-success" type="submit">Search</button>
                        </form>
                    </div>
                </div>
            </nav>
            <div className="container">
                {movies.map(movie => (
                    <div className="card" style={{ width: '18rem' }} key={movie.id}>
                        <img src={movie.posterUrl} className="card-img-top" alt={movie.title} />
                        <div className="card-body">
                            <h5 className="card-title">{movie.title}</h5>
                            <p className="card-text">{movie.description}</p>
                            <Link to={`/movies/${movie.id}`} className="btn btn-primary">View Details</Link>
                        </div>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default HomePage;
